Okay, let's design this computational model step-by-step.

1.  **Goal:** Predict responder acceptance (`accept` = 1 or 0) based on the proposal and context.
2.  **Core Idea:** Acceptance depends on the utility derived from the proposed share (`split_self`). This utility is influenced by both the absolute amount received and how fair that amount is perceived to be, considering the contributions (`token_self`, `token_opp`).
3.  **Utility Function:** We need a function `U` such that higher `U` means higher likelihood of acceptance. A standard approach in behavioral economics is to model utility based on self-interest and inequity aversion.
4.  **Self-Interest Component:** The direct monetary gain, `split_self`, should positively influence utility.
5.  **Fairness Component:** Fairness perception depends on contributions. A "fair" share for the participant, based on proportional contribution, would be `prop_fair_share_self = combined_earning * (token_self / (token_self + token_opp))`. We need to handle the case where `token_self + token_opp = 0`. In this case, `combined_earning` is also 0, and `split_self` must be 0. We can define `prop_fair_share_self = 0` in this scenario.
6.  **Inequity Aversion:** Participants might dislike outcomes deviating from this fair share. Crucially, they usually dislike *disadvantageous* inequity (`split_self < prop_fair_share_self`) more than *advantageous* inequity (`split_self > prop_fair_share_self`). This asymmetry is captured by parameters `alpha` (for disadvantageous) and `beta` (for advantageous inequity).
7.  **Mathematical Formulation (Fehr-Schmidt style adapted for contribution):**
    *   Utility `U` = Payoff - Penalty for disadvantageous inequity - Penalty for advantageous inequity.
    *   `U = split_self - alpha * max(prop_fair_share_self - split_self, 0) - beta * max(split_self - prop_fair_share_self, 0)`
    *   Where `alpha >= 0` and `beta >= 0`. Often, theory suggests `alpha >= beta`.
8.  **Parameters:**
    *   `alpha`: Sensitivity to getting less than the contribution-based fair share. Learnable.
    *   `beta`: Sensitivity to getting more than the contribution-based fair share. Learnable.
9.  **Decision Rule:** The utility `U` is transformed into a probability of acceptance using a logistic function: `P(accept) = 1 / (1 + exp(-U))`. This matches the requirement that `U < 0` implies `P(accept) < 0.5`.
10. **Parameter Bounds:** We need finite, generous bounds. `alpha` and `beta` represent sensitivities/weights. Non-negative values make sense. A range like [0, 10] for both seems generous enough to capture a wide range of behaviors while remaining finite. This allows `beta` to be larger than `alpha`, even if less common theoretically.
11. **Parameter Recovery:** This model structure is relatively standard and the two parameters capture distinct psychological components (reactions to getting "too little" vs. "too much" relative to fairness). This separation should aid identifiability, assuming the offers in the dataset vary sufficiently relative to the calculated fair shares. Using only two parameters helps reduce potential covariance issues compared to more complex models.
12. **Data Mapping:** The model uses `split_self`, `combined_earning`, `token_self`, `token_opp` directly from the dataset to calculate `prop_fair_share_self` and then `U`. The target variable is `accept`.

